import React, {useEffect} from 'react'

const AddProductPage = () => {
  useEffect(() => {
    if (isError) {
      console.log(message);
    }
    if (!user) {
      navigate('/login');
    }
    dispatch(getAccountInfos());
    return () => {
      dispatch(reset());
    };
  }, [user, navigate, isError, message, dispatch]);
  if (isLoading) {
    return <Spinner />;
  }
  return (
    <div>
      AddProductPage
    </div>
  )
}

export default AddProductPage
